```json
{
"application": "WRF",
"details": {
"resource_requirements": {
"nodes": 2,
"partition": "wrfc6gn",
"tasks_per_node": 64,
"cpus_per_task": 1,
"tasks_per_core": 1,
"environment_variables": {
"WRF_VERSION": "3.9.1",
"JOB_DIR": "/fsx/spooler/run",
"HPC_MPI": "openmpi",
"WARCH": "intelmpi",
"WRF_COMPILER": "intel"
}
},
"software_requirements": {
"compiler": {
"options": [
"intel",
"gnu/gcc",
"gnu/clang",
"amd/clang",
"arm/gcc",
"arm/clang"
],
"default": "intel"
},
"mpi": {
"options": [
"openmpi",
"mpich",
"intelmpi"
],
"default": "openmpi"
}
},
"script_details": {
"slurm_directives": [
"wait-all-nodes=1",
"ntasks-per-node=64",
"cpus-per-task=1",
"ntasks-per-core=1",
"export=ALL",
"exclusive",
"output=/fsx/slurm.out",
"nodes=2",
"partition=wrfc6gn"
],
"environment_setup": {
"source": "/fsx/scripts/env.sh 0 0",
"ulimit": "-s unlimited"
},
"execution": {
"command": "mpirun --mca pml cm --mca mtl ofi --mca pml_base_verbose 10 --mca mtl_base_verbose 10 ./wrf.exe",
"output_file": "mpirun_${WARCH}_${WRF_COMPILER}_${HPC_MPI}_debug.log"
},
"logging": {
"timing_file": "wrf_$(arch).times"
}
}
}
```
